const fontFamilyDefault = "'Myriad Pro', Myriad, MyriadPro-Regular,'Myriad Pro Regular', MyriadPro, 'Myriad Pro', 'Liberation Sans','Nimbus Sans L', 'Helvetica Neue', vegur, Vegur, Helvetica, Arial, sans-serif";

//colors
//official colors for Eurostat logo and statistical domains
const color = {
	logo: { gray: "#787878", blue: "#004494", yellow: "#FFF100" },
	theme: { genreg: "#466eb4", ecofin: "#af4b91", popsoc: "#e6a532", indtradserv: "#00a0e1", agrifish: "#7daf4b", trade: "#b93c46", transp: "#961e2d", envener: "#41afaa", scitech: "#d7642d" }
}


//REST API

const getEstatRestDataURLBase = "https://ec.europa.eu/eurostat/wdds/rest/data/";

/**
 * Build URL to fetch data from eurobase REST API.
 * @param {string} datasetCode The Eurobase dataset code
 * @param {object=} filters The filter parameters as for example: {key:value,key:[value1,value2,value3]}
 * @param {number=} lang
 * @param {number=} format
 * @param {number=} version
 */
const getEstatDataURL = function (datasetCode, filters, lang, format, version) {
	lang = lang || "en";
	format = format || "json";
	version = version || "2.1";
	var url = [];
	url.push(getEstatRestDataURLBase, "v", version, "/", format, "/", lang, "/", datasetCode, "?");
	if (filters)
		for (var param in filters) {
			var o = filters[param];
			if (Array.isArray(o))
				for (var i = 0; i < o.length; i++)
					url.push("&", param, "=", o[i]);
			else url.push("&", param, "=", o);
		}
	return url.join("");
};


//flags
const flags = { b: "break in time series", c: "confidential", d: "definition differs, see metadata", e: "estimated", f: "forecast", n: "not significant", p: "provisional", r: "revised", s: "Eurostat estimate", u: "low reliability", z: "not applicable" }



