	if (dict.EU) dict.EU = { en: "European Union", fr: "Union européenne", de: "Europäische Union" }[lg];
	if (dict.EEA) dict.EEA = { en: "European Economic Area", fr: "Espace économique européen", de: "Europäischer Wirtschaftsraum" }[lg];
