/**
 * @param{string} string
 * @return{string}
 */
const escapeRegExp = function (string) {
	return string.replace(/([.*+?^=!:${}()|\[\]\/\\])/g, "\\$1");
};

/**
 * @param {string} string
 * @param {string} find
 * @param {string} replace
 * @return {string}
 */
const replaceAll = function (string, find, replace) {
	return string.replace(new RegExp(escapeRegExp(find), 'g'), replace);
};

/**
 * @param {Array} x
 * @param {Array} y
 * @return {Array}
 */
const unionArrays = function (x, y) {
	var obj = {}, i, nb;
	for (i = 0, nb = x.length; i < nb; i++) {
		var xi = x[i];
		obj[xi] = xi;
	}
	for (i = 0, nb = y.length; i < nb; i++) {
		var yi = y[i];
		obj[yi] = yi;
	}
	var res = [];
	for (var k in obj)
		if (obj.hasOwnProperty(k)) res.push(obj[k]);
	return res;
};

//{1:"fff",df:15} to ["fff",15]
const objValuesToArrays = function (obj) {
	return Object.keys(obj).map(function (k) { return obj[k]; });
};

/**
 * @param{number} num
 * @return {string}
 */
const numberWithSpaces = function (num) {
	var str = num.toString().split('.');
	if (str[0].length >= 5)
		str[0] = str[0].replace(/(\d)(?=(\d{3})+$)/g, "$1 ");
	if (str[1] && str[1].length >= 5)
		str[1] = str[1].replace(/(\d{3})/g, "$1 ");
	return str.join('.');
};



function preventDefault(e) {
	e = e || window.event;
	if (e.preventDefault) e.preventDefault();
	e.returnValue = false;
}

const disableScrolling = function () {
	if (window.addEventListener)
		window.addEventListener('DOMMouseScroll', preventDefault, false);
	window.onmousewheel = document.onmousewheel = preventDefault;
};

const enableScrolling = function () {
	if (window.removeEventListener)
		window.removeEventListener('DOMMouseScroll', preventDefault, false);
	window.onmousewheel = document.onmousewheel = null;
};





//From https://code.google.com/p/stringencoders/source/browse/trunk/javascript/base64.js
const encodeBase64 = function (s) {
	if (arguments.length !== 1) {
		throw new SyntaxError("Not enough arguments");
	}

	var getbyte = function (s, i) {
		var x = s.charCodeAt(i);
		if (x > 255) {
			console.log("Error");
			return null;
		}
		return x;
	};

	var padchar = '=';
	var alpha = 'ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/';

	var i, b10;
	var x = [];

	// convert to string
	s = '' + s;

	var imax = s.length - s.length % 3;

	if (s.length === 0) {
		return s;
	}
	for (i = 0; i < imax; i += 3) {
		b10 = (getbyte(s, i) << 16) | (getbyte(s, i + 1) << 8) | getbyte(s, i + 2);
		x.push(alpha.charAt(b10 >> 18));
		x.push(alpha.charAt((b10 >> 12) & 0x3F));
		x.push(alpha.charAt((b10 >> 6) & 0x3f));
		x.push(alpha.charAt(b10 & 0x3f));
	}
	switch (s.length - imax) {
		case 1:
			b10 = getbyte(s, i) << 16;
			x.push(alpha.charAt(b10 >> 18) + alpha.charAt((b10 >> 12) & 0x3F) +
				padchar + padchar);
			break;
		case 2:
			b10 = (getbyte(s, i) << 16) | (getbyte(s, i + 1) << 8);
			x.push(alpha.charAt(b10 >> 18) + alpha.charAt((b10 >> 12) & 0x3F) +
				alpha.charAt((b10 >> 6) & 0x3f) + padchar);
			break;
	}
	return x.join('');
};

